import { Component } from '@angular/core';
import { Menu } from './interfaces/menu';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'ProyectoAngular16';
  public menu: Menu[] = [
    {
      title: 'listado',
      route: 'listado'
    },
    {
      title: 'crear',
      route: 'crear'
    }
  ]
}
